import React, { Component } from "react";

import Navbar from "./Navbar";
import AllBoards from "./AllBoards";

export class App extends Component {
	render() {
		return (
			<div className="container">
				<Navbar />
				<AllBoards />
			</div>
		);
	}
}

export default App;
